import React from "react";
import classes from "./Icons.module.css";
import { useState, useEffect } from "react";

function Icons(props) {
  return (
    <div className={classes.container}>
      <div className={classes.cards}>
        <div className={classes.wraper}>
          <div className={classes.title_wraper}>
            <p className={classes.title}>Build with the best ecosystems</p>
          </div>
          <div className={classes.title_wraper}>
            <p className={classes.title}>on DoraHacks</p>
          </div>
        </div>
        <div className={classes.wraper_two}>
          <div className={classes.img_container}>
            <img
              className={classes.centered}
              alt="icons"
              src={"https://dorahacks.io/_nuxt/b1cefbd7.svg"}
            />
            {/* <img alt="icons1" src={"https://dorahacks.io/_nuxt/b1cefbd7.svg"} />
            <img alt="icons2" src={"https://dorahacks.io/_nuxt/d8f74907.svg"} /> */}
          </div>
        </div>
      </div>
    </div>
  );
}

export default Icons;
